        <hide-credential credential="item.loginProfile.data.password" class="ng-isolate-scope"><span class="hide-credential">

        <!-- ngIf: table.actionsColumn -->
        </div><!-- end ngIf: !item.item.__isGroupHeader -->
        <!-- ngIf: table.isExpanded(item.id) --><div class="row ng-scope ng-isolate-scope expanded-row" item="item.item" ng-class="[table.expandableRow.class, table.rowClass(item.item)]" ng-if="table.isExpanded(item.id)" transclude-template="table.expandableRow">
        <div class="cell errors-alert-box-cell ng-scope">

        <log-entry name="createUser" class="ng-scope ng-isolate-scope"><!-- ngRepeat: result in results --><!-- ngIf: result.isError || result.data --><div class="log-entry ng-scope" ng-if="result.isError || result.data" ng-repeat="result in results">
        <div class="icon awsui-util-t-c">
        <span class="awsui-icon alert-check-circle" ng-class="result.isError ? 'alert-exclamation-circle' : 'alert-check-circle'"></span>
        </div>
        <div class="entry">
        <!-- ngIf: !result.isError --><div augment-scope="result.data as $data, result.params as $params" class="success ng-scope" magic-transclude="success" ng-if="!result.isError"><success translate="" class="ng-scope"><span class="ng-binding ng-scope">Se ha creado el usuario eddremonts</span></success></div><!-- end ngIf: !result.isError -->
        <!-- ngIf: result.isError -->
        </div>
        <div class="awsui-util-clearfix"></div>
        </div><!-- end ngIf: result.isError || result.data --><!-- end ngRepeat: result in results -->
        </log-entry>
        <log-entry name="attachPolicies" class="ng-scope ng-isolate-scope"><!-- ngRepeat: result in results --><!-- ngIf: result.isError || result.data --><!-- end ngRepeat: result in results -->

        <log-entry name="addToGroups" class="ng-scope ng-isolate-scope"><!-- ngRepeat: result in results --><!-- ngIf: result.isError || result.data --><div class="log-entry ng-scope" ng-if="result.isError || result.data" ng-repeat="result in results">
        <div class="icon awsui-util-t-c">
        <span class="awsui-icon alert-check-circle" ng-class="result.isError ? 'alert-exclamation-circle' : 'alert-check-circle'"></span>
        </div>
        <div class="entry">
        <!-- ngIf: !result.isError --><div augment-scope="result.data as $data, result.params as $params" class="success ng-scope" magic-transclude="success" ng-if="!result.isError"><success translate="" class="ng-scope"><span class="ng-binding ng-scope">Se ha añadido un usuario eddremonts al grupo Admin</span></success></div><!-- end ngIf: !result.isError -->
        <!-- ngIf: result.isError -->
        </div>
        <div class="awsui-util-clearfix"></div>
        </div><!-- end ngIf: result.isError || result.data --><!-- end ngRepeat: result in results -->
        </log-entry>
        <log-entry name="copyInlinePolicies" class="ng-scope ng-isolate-scope"><!-- ngRepeat: result in results --><!-- ngIf: result.isError || result.data --><!-- end ngRepeat: result in results -->
        </log-entry>
        <log-entry name="createAccessKey" class="ng-scope ng-isolate-scope"><!-- ngRepeat: result in results --><!-- ngIf: result.isError || result.data --><div class="log-entry ng-scope" ng-if="result.isError || result.data" ng-repeat="result in results">
        <div class="icon awsui-util-t-c">
        <span class="awsui-icon alert-check-circle" ng-class="result.isError ? 'alert-exclamation-circle' : 'alert-check-circle'"></span>
        </div>
        <div class="entry">
        <!-- ngIf: !result.isError --><div augment-scope="result.data as $data, result.params as $params" class="success ng-scope" magic-transclude="success" ng-if="!result.isError"><success translate="" class="ng-scope"><span class="ng-binding ng-scope">Se ha creado una clave de acceso para el usuario eddremonts</span></success></div><!-- end ngIf: !result.isError -->
        <!-- ngIf: result.isError -->
        </div>
        <div class="awsui-util-clearfix"></div>
        </div><!-- end ngIf: result.isError || result.data --><!-- end ngRepeat: result in results -->
        </log-entry>
        <log-entry name="createLoginProfile" class="ng-scope ng-isolate-scope"><!-- ngRepeat: result in results --><!-- ngIf: result.isError || result.data --><!-- end ngRepeat: result in results -->
        </log-entry>
        </div>
        </error-log></span></div></div></awsui-alert>
        </div>
        </div><!-- end ngIf: table.isExpanded(item.id) -->
